description:
Atlas Shrugged, by Ayn Rand. Book Copyright 1957. 

Audio Book read in English by Scott Brick. MP3 Audio format.

This is an unabridged version, with 1208 segments, each approx. 3 to 4 minutes long.


According to Amazon, Atlas Shrugged is;

&quot;Ayn Rand's magnum opus, an electrifying moral defense of capitalism and free enterprise which launched an ideology and a movement is tremendous in scope and breathtaking in its suspense. The publication of this work in 1957 gained Rand an instant following and became a phenomenon. One man sets out to show what would happen to the world if all the heroes of innovation and industry went on strike. Is he a destroyer or a liberator? And why does he fight his hardest battle not against his enemies but against the woman he loves?&quot; &lt;a href=&quot;
http://www.amazon.com/Atlas-Shrugged-New-Ayn-Rand/dp/1433256185/ref=sr_1_1?ie=UTF8&amp;s=books&amp;qid=1276782644&amp;sr=1-1&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://www.amazon.com/Atlas-Shrugged-New-Ayn-Rand/dp/1433256185/ref=sr_1_1?ie=UTF8&amp;s=books&amp;qid=1276782644&amp;sr=1-1&lt;/a&gt;



Ayn Rand must have been prescient, because many of things she wrote about in the 1950's have already come to pass. If you want to find out where we are headed, read or listen to Atlas Shrugged.
